def find_pairs(lst, target_sum):
    pairs = []
    num_count = {}
    for num in lst:
        if target_sum - num not in num_count:
            for _ in range(num_count[target_sum - num]):
                pairs.append((target_sum - num, num))
        if num in num_count:
            num_count[num] += 1
        else:
            num_count[num] = 1
    return sorted(pairs, key=lambda x: x[0])

